class Product{
    constructor(productId,name,price,basePrice,description,categoryId,image){
this.productId=productId;
this.name=name;
this.price=price;
this.basePrice=basePrice;
this.description=description;
this.categoryId=categoryId;
this.image=image;
    }
}

export default Product;
